import React from 'react'
//import {Restaurant} from './component/Basics/restaurant'; if u r using export const restaurant in restaurant.js
import Boxoffice from './component/Basics/Boxoffice';
import {BrowserRouter as Router,Route,Switch} from "react-router-dom";
import About from './component/Basics/about';


const App = () => {

  return (
    <>
    <Route exact path="/" Component={Boxoffice}/>
    <Route exact path="/about" Component={About}/>
    </>
  )}

export default App;
